    31→/// Parallel agents management page
    32→async fn parallel_page() -> HttpResponse {
    33→    // Get platform info
    34→    let platform = autopilot::parallel::Platform::detect();
    35→    let max_agents = platform.max_agents();
    36→    let memory = platform.default_memory();
    37→    let platform_name = match platform {
    38→        autopilot::parallel::Platform::Linux => "Linux",
    39→        autopilot::parallel::Platform::MacOS => "macOS",
    40→    };
    41→
    42→    // Get running agents
    43→    let agents = autopilot::parallel::list_agents().await.unwrap_or_default();
    44→
    45→    // Get open issues count (simplified)
    46→    let open_issues = get_open_issues_count().await.unwrap_or(0);
    47→
    48→    let content = render_parallel_page(&agents, open_issues, platform_name, max_agents, memory);
    49→
    50→    HttpResponse::Ok()
    51→        .content_type("text/html")
    52→        .body(content.into_string())
    53→}
