   183→fn render_status(status: &autopilot::parallel::AgentStatus) -> Markup {
   184→    let (color, text) = match status {
   185→        autopilot::parallel::AgentStatus::Running => ("#7dff7d", "Running"),
   186→        autopilot::parallel::AgentStatus::Stopped => ("#666", "Stopped"),
   187→        autopilot::parallel::AgentStatus::Starting => ("#ffd97d", "Starting"),
   188→        autopilot::parallel::AgentStatus::Error => ("#ff7d7d", "Error"),
   189→    };
   190→    html! {
   191→        span style=(format!("color: {}; font-size: 0.85rem;", color)) { (text) }
   192→    }
   193→}
