   195→fn format_uptime(seconds: u64) -> String {
   196→    if seconds < 60 {
   197→        format!("{}s", seconds)
   198→    } else if seconds < 3600 {
   199→        format!("{}m {}s", seconds / 60, seconds % 60)
   200→    } else {
   201→        let hours = seconds / 3600;
   202→        let minutes = (seconds % 3600) / 60;
   203→        format!("{}h {}m", hours, minutes)
   204→    }
   205→}
