   207→async fn get_open_issues_count() -> anyhow::Result<usize> {
   208→    let db_path = "autopilot.db";
   209→    if !std::path::Path::new(db_path).exists() {
   210→        return Ok(0);
   211→    }
   212→    let conn = rusqlite::Connection::open(db_path)?;
   213→    let count: i64 = conn.query_row(
   214→        "SELECT COUNT(*) FROM issues WHERE status = 'open'",
   215→        [],
   216→        |row| row.get(0),
   217→    )?;
   218→    Ok(count as usize)
   219→}
