   221→/// Start N parallel agents
   222→async fn start_agents(form: web::Form<StartAgentsForm>) -> HttpResponse {
   223→    let count = form.count.unwrap_or(3);
   224→    info!("Starting {} parallel agents", count);
   225→
   226→    match autopilot::parallel::start_agents(count).await {
   227→        Ok(_agents) => {
   228→            HttpResponse::Ok().json(AgentResponse {
   229→                success: true,
   230→                message: Some(format!("Started {} agents", count)),
   231→            })
   232→        }
   233→        Err(e) => {
   234→            HttpResponse::InternalServerError().json(AgentResponse {
   235→                success: false,
   236→                message: Some(format!("Failed to start agents: {}", e)),
   237→            })
   238→        }
   239→    }
   240→}
   241→
   242→/// Stop all parallel agents
   243→async fn stop_agents() -> HttpResponse {
   244→    info!("Stopping all parallel agents");
   245→
   246→    match autopilot::parallel::stop_agents().await {
   247→        Ok(_) => HttpResponse::Ok().json(AgentResponse {
   248→            success: true,
   249→            message: Some("All agents stopped".to_string()),
   250→        }),
   251→        Err(e) => HttpResponse::InternalServerError().json(AgentResponse {
   252→            success: false,
   253→            message: Some(format!("Failed to stop agents: {}", e)),
   254→        }),
   255→    }
   256→}
