   328→/// Get logs for a specific agent
   329→async fn agent_logs(path: web::Path<String>) -> HttpResponse {
   330→    let agent_id = path.into_inner();
   331→
   332→    match autopilot::parallel::get_logs(&agent_id, Some(100)).await {
   333→        Ok(logs) => {
   334→            let html = format!(
   335→                r#"<div style="position: fixed; top: 50%; left: 50%; transform: translate(-50%, -50%); background: #1a1a1a; border: 1px solid #3a3a3a; padding: 1rem; max-width: 800px; max-height: 600px; overflow: auto; z-index: 1000;">
   336→                    <div style="display: flex; justify-content: space-between; align-items: center; margin-bottom: 1rem; border-bottom: 1px solid #3a3a3a; padding-bottom: 0.5rem;">
   337→                        <h3 style="color: #4a9eff; margin: 0;">Logs: agent-{}</h3>
   338→                        <button onclick="this.closest('div').parentElement.innerHTML=''" style="background: #501616; color: #ff7d7d; border: none; padding: 0.25rem 0.5rem; cursor: pointer;">Close</button>
   339→                    </div>
   340→                    <pre style="font-family: monospace; font-size: 0.75rem; color: #a0a0a0; white-space: pre-wrap; word-wrap: break-word;">{}</pre>
   341→                </div>"#,
   342→                agent_id,
   343→                html_escape(&logs)
   344→            );
   345→
   346→            HttpResponse::Ok()
   347→                .content_type("text/html")
   348→                .body(html)
   349→        }
   350→        Err(e) => HttpResponse::InternalServerError()
   351→            .content_type("text/html")
   352→            .body(format!(r#"<p style="color: #ff7d7d;">Error: {}</p>"#, e)),
   353→    }
   354→}
   355→
   356→fn html_escape(s: &str) -> String {
   357→    s.replace('&', "&amp;")
   358→        .replace('<', "&lt;")
   359→        .replace('>', "&gt;")
   360→        .replace('"', "&quot;")
   361→        .replace('\'', "&#39;")
   362→}
